import React from "react";
import ReactDOM from "react-dom";
import add from "./App"

ReactDOM.render(
    <>
        <ol>
            <li> Sum of Two Numbers are = {add(30,3)} </li>
           <li> Sub of Two Numbers are = {sub(30,3)}</li>

        </ol>
    </>,
    document.getElementById("root")

);
